import React from 'react';
import HeaderCart from '../NavCart/HeaderCart';
import classes from './Header.module.css'


const Header = () => {
  return (
   <header className={classes.head}>
    <h1>ReactMeals</h1>
    <HeaderCart/>
    
   </header>
  )
}

export default Header
